import React from "react";
import { Link } from "react-router-dom";
import "./nav.css";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/home">Home</Link>
        </li>
        <li>
          <Link to="/course/running">Running</Link>
        </li>
        <li>
          <Link to="/home/registration">Registration</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
